  }

  return (
    <div className='App'>
      <Nav />
      <Content1 />
      <section className='menu section'>
        {topics.map((topic) => <Cards {...topic} displayCard={displayCard} />)}
      </section>
      <FAQs />
      <Footer />
    </div>
  )
}

export default App;
